DROP TABLE IF EXISTS magazine_contents;
DROP TABLE IF EXISTS magazines;

CREATE TABLE magazines (
    id SERIAL PRIMARY KEY,
    title TEXT NOT NULL,
    author TEXT NOT NULL,
    publication_date DATE,
    category TEXT
);

CREATE TABLE magazine_contents (
    id SERIAL PRIMARY KEY,
    magazine_id INTEGER REFERENCES magazines(id),
    article_title TEXT NOT NULL,
    content TEXT NOT NULL,
    keyword_search_vector tsvector,
    vector_representation vector(384)
);




UPDATE magazine_contents c
SET keyword_search_vector = 
    setweight(to_tsvector('english', m.title), 'A') ||
    setweight(to_tsvector('english', m.author), 'A') ||
    setweight(to_tsvector('english', c.content), 'B')
FROM magazines m
WHERE c.magazine_id = m.id;

CREATE INDEX keyword_search_vector_idx ON magazine_contents USING GIN(keyword_search_vector);
ANALYZE magazine_contents;